class Song extends Component {

  render() {
    return (
          <div>

            <li>Title: {this.props.song.title} </li>
            <li>Artist: {this.props.song.artist} </li>
            <li>Genre: {this.props.song.genre} </li>

            <button></button>
          <br></br>
          </div>

    );
  }
};

export default Song;
